/**
                         * 定时任务管理器
                         */
(function () {
  function Timer() {
    /**
                     * @description 回调对象集合
                     * @example 
                     * [{
                    	 // 名称
                    	 name: "",
                    	 // 执行函数
                    	 async run(){}
                    	}]
                     */
    var list = [];

    // 定时器核心
    this.core;

    /**
                * @description 执行
                */
    Timer.prototype.run = function () {
      var len = list.length;
      for (var i = 0; i < len; i++) {
        var run = list[i].run;
        if (run) {
          run();
        }
      }
    };

    /**
        * @description 启动
        */
    Timer.prototype.start = function () {
      var _this = this;
      if (!this.core) {
        this.core = setInterval(this.run, 1000);
      }
    };

    /**
        * @description 结束
        */
    Timer.prototype.end = function () {
      clearInterval(this.core);
      this.core = undefined;
    };

    /**
        * @description 添加定时执行任务
        */
    Timer.prototype.add = function (obj) {
      if (typeof obj === "object") {
        if (obj.name && obj.run && typeof obj.run === 'function') {
          list.push(obj);
        }
      }
    };
    /**
        * @description 删除定时执行任务
        */
    Timer.prototype.del = function (name) {
      if (typeof obj === "object") {
        list.del({
          name: name },
        true);
      }
    };
  };
  uni.timer = new Timer();
})();


