    /**
        * 跳转指定页
        * @param {Number} page 页码
        */
    goTo: function goTo(page) {
      if (page < 1) {
        page = 1;
      } else if (page > this.page_count) {
        page = this.page_count;
      }
      var query = this.query;
      var p = query.page;
      query.page = page;

      if (this.page_count !== 0) {
        if (p + 1 == page) {
          this.next(query);
        } else if (p - 1 == page) {
          this.prev(query);
        } else {
          this.first(query);
        }
      } else {
        this.first(query);
      }
    },

